{'response': 'Dear love, for nothing less than thee
Shall move the earth or stir the sea;
No golden sun, no silver moon
Can charm my heart, nor change its tune.

For all the stars that crown the night
Are pale beside thy gentle light;
And every hope, and every plea,
Finds root in nothing less than thee.

So let the world its wonders show—
Its fleeting joys, its transient glow;
My soul will only rest, be free,
In steadfast faith, in love, in thee.', 'probability': 1.0}

{'response': 'Dear love, for nothing less than thee
Would I forsake the world entire;
No crown, no coin, no destiny,
Could spark in me such steady fire.

Your laughter is the morning dew
Upon the grass of waking dreams;
Your words, the light that guides me through
The tangled wood of hopes and schemes.

So let them offer all they may—
The stars, the sky, eternity;
I’ll answer with a gentle sway:
Dear love, for nothing less than thee.', 'probability': 1.0}

{'response': 'Dear love, for nothing less than thee
Would I surrender time or fate;
Not jewels, nor fame, nor liberty
Could tempt my heart to hesitate.

For in your gaze, the world dissolves,
Each fear and shadow falls away;
The secret pulse that life resolves
Beats stronger in your light each day.

So let the restless tempests blow,
Let seasons turn and empires fall;
Dear love, I have no wish to know
A joy less bright than thee at all.', 'probability': 1.0}

{'response': 'Their flags and their banners they are waving with joy and excitement they shout,
A parade of tomorrows comes streaming, their voices a jubilant route.
The sunlight ignites every ribbon and thread, confessions of faith in the air;
They gather and cheer for the dreams in their hearts, for promises made with a prayer.
Let hope be the standard we rally beneath, let laughter ring out without end—
For here in the throng, we belong to the song, and each stranger is suddenly friend.', 'probability': 1.0}

{'response': "War's a joke for me and you,
A play we watch from velvet seats;
We cheer the lines, the bright review,
Unmindful of the tangled streets.

We banter, sip our evening wine,
Exchange a quip, dismiss the news;
Forget the bodies left behind,
The mothers who have paid their dues.

But laughter rings a hollow bell
When echoed through a battle's roar;
For those who’ve walked through living hell,
War’s a joke—no more, no more.", 'probability': 1.0}

{'response': 'From childhood’s hour I have not been
A dweller in the ordinary light;
I learned the language of the wind,
And danced alone through sleepless night.

The world wore colors I could see,
But could not touch with eager hand;
I wandered paths where shadows flee,
And built my dreams on shifting sand.

The laughter of the others grew
Like distant bells, not meant for me;
Yet in the quiet, something new—
A secret song of mystery.

From childhood’s hour I have not been
A child of earth, but air and sea;
Yet what I lost, I found within:
A spark of strange eternity.', 'probability': 1.0}

{'response': "From childhood's hour I have not been
Like other hearts that freely beat;
A silent pulse, a shadowed sheen,
Set mine apart from crowded street.

I walked in rain while others played,
I listened to the world alone;
The colors of the sun would fade,
But in the dark, I made my home.

Unseen by those with laughing eyes,
I kept a lantern for the lost;
A gentle fire against the skies,
A warmth that never counted cost.

From childhood’s hour, I carved my way
Through midnight’s hush and morning’s chill;
And though I’m different, I can say
My soul is singing, stranger still.", 'probability': 1.0}

{'response': 'From childhood’s hour I have not been
A mirror for the world’s bright face;
Instead, I wandered in between
The shadows cast by time and place.

I watched the dances, heard the tunes,
Felt every echo, soft and wild;
My heart was drawn by haunted moons,
A solitary, dreaming child.

The laughter of the others rang
Like distant chimes beyond my touch;
But in the silence, something sang—
A voice that understood so much.

From childhood’s hour, set apart,
I built a kingdom out of air;
And though I bear a different heart,
It’s filled with wonders, rare and rare.', 'probability': 1.0}

{'response': "From childhood's hour I have not been
A simple soul, nor wholly seen;
The world around—a painted screen,
While I, behind, drifted between.

The laughter of the playground faded,
Echoed soft in distant rooms;
My thoughts, by other dreams invaded,
Wove their own elusive looms.

I have not tasted summer's ease
Nor joined in games beneath the sun;
Instead, I sought the autumn trees,
And found the songs the shadows spun.

From childhood’s hour I have not known
The path that others gladly claim;
Yet in the dusk I walk alone,
And wear my difference without shame.", 'probability': 1.0}

{'response': 'From childhood’s hour I have not been
A leaf on wind, nor sunbeam free;
I’ve wandered realms that lie between
The world’s embrace and mystery.

The laughter ringing through the halls
Would curl and fade before my ears;
I traced the patterns on the walls
And learned to live with secret fears.

I’ve watched the seasons ebb and flow,
Unanchored by the games they played;
The silent wisdom few may know
Became the friend that never strayed.

From childhood’s hour, I have not danced
Where light and mirth entwine the day;
Yet in the shadows, I’ve romanced
A life that’s beautiful in gray.', 'probability': 1.0}

{'response': "From childhood's hour I have not been
A creature of the common crowd;
My thoughts were rivers running in
To silent valleys, wrapped in cloud.

I watched the laughter from afar,
A shadow in the summer grass;
The world, a lantern, hung with stars,
Flickered as I let it pass.

Yet in the quiet, I have grown
A garden wild with dreams unseen;
From childhood’s hour I have not known
The world, but worlds that lie between.", 'probability': 1.0}

{'response': "From childhood's hour I have not been
A dweller of the sunlit green;
Instead, I wandered shadowed halls,
Dreamed in the hush where silence falls.

The laughter of the others rang,
A distant bell, a crystal clang;
Yet I would turn with wistful eyes,
To catch the drift of cloudy skies.

In every echo, every shade,
The world’s bright colors softly fade;
I walk a path apart, unseen—
From childhood’s hour, I have not been.", 'probability': 1.0}

{'response': 'From childhood’s hour I have not been
A stranger to the storm within;
While laughter pealed in golden light,
My soul was stirred by coming night.

I watched the world with ancient eyes,
Found wonder in the cloudy skies;
The hidden depths, the whispered fears,
The poetry of vanished years.

So now I walk this shadowed lane,
And carry both my joy and pain;
For from that hour, I have not been
Apart from sorrow, nor from dream.', 'probability': 1.0}

{'response': 'From childhood’s hour I have not been
Quite woven from the common thread;
I’ve chased the silence in between
The words that others left unsaid.

The world, a riddle, whispered low,
A song that only I could know;
While others danced on summer’s green,
I wandered where the dusk had been.

So let me keep this secret part—
The haunted chambers of my heart;
From childhood’s hour I have not been
The same as others, nor have seen.', 'probability': 1.0}

{'response': 'On the scene came Christ The Lord, not with peace but with a sword.
His footsteps echoed prophecy, His gaze a sharpened blade.
He did not come to coddle lies or soothe us into shade;
He came to separate the gold from dross, the wheat from chaff,
To call us to the narrow path, to cut deceit in half.
His words, a challenge fierce and bold, ignited sacred strife,
Demanding that we choose the truth, the cost, the cross, the life.
No lull of easy comfort sang within His piercing call;
He came, the sword of justice drawn, to lift, divide, enthrall.', 'probability': 1.0}

{'response': 'Fire up the sky with rocket sparks!
Let dreams ascend on thunder’s wings;
In fleeting arcs, the future marks
Its promise in the light it brings.

We gather close, our faces bright,
Our laughter woven with the night;
Each rocket’s flare, a beating heart
Inscribing hope upon the dark.

So let us rise, ignite our marks—
United by this joyful lark;
Together, now, as wonder starts,
We fire up the sky with rocket sparks!', 'probability': 1.0}

{'response': 'Fire up the sky with rocket sparks!
Let celebration split the night;
We scribble joy in glowing marks,
A canvas drawn in fleeting light.

From rooftops, fields, and city parks,
Our gasps and laughter intertwine;
We launch our wishes, wild and stark,
To ride the rockets as they shine.

For every flame that climbs the air,
A thousand hearts will rise and hark;
We find our courage burning there,
As we fire up the sky with sparks!', 'probability': 1.0}

{'response': 'O God! Thou art my God alone;
The ancient stars bear witness true,
Before Thy throne, my heart is known—
Its joys, its griefs, its hopes anew.

No fleeting shade, nor crafted stone,
Shall claim the awe my soul bestows;
For in the hush, when I am prone,
Thy gentle spirit softly flows.

Forever bound, yet wholly free,
I cling to Thee, my guiding light;
O God! My God, eternally—
My dawn, my dusk, my darkest night.', 'probability': 1.0}

{'response': "O God! Thou art my God alone;  
Upon the mountain's edge I stand,  
Where morning breaks with golden tone,  
And life is cupped within Thy hand.  

No idol claims this longing heart,  
No fleeting joy, nor passing pride;  
For in Thy presence, fears depart,  
And in Thy shadow I abide.  

Through valleys deep and tempests wild,  
My hope endures, my faith is grown;  
For I am Thine, Thy chosen child—  
O God! Thou art my God alone.", 'probability': 1.0}

{'response': 'O God! Thou art my God alone;  
When night descends and day is done,  
I whisper prayers before Thy throne,  
And find my peace in Thee begun.  

No riches lure, nor praises sweet,  
Can draw my soul from Thee away;  
Within Thy love, my joy complete,  
I walk beside Thee, come what may.  

The world may change, its colors fade,  
Yet steadfast is Thy love and tone;  
In every breath, my heart has prayed—  
O God! Thou art my God alone.', 'probability': 1.0}

{'response': 'O God! Thou art my God alone;
Before the dawn, my spirit yearns.
Thy presence calls me as my own,
A sacred fire that ever burns.

No idols rise within my heart;
No rival claim can find its place.
In every joy, in every part,
I seek the comfort of Thy face.

Thy mercy flows, an endless sea;
Thy wisdom guides me through the night.
O God, in faith I cling to Thee—
My anchor, refuge, and my light.', 'probability': 1.0}

{'response': 'I was a grovelling creature once,
Hunched in silence, fearing light;
A shadowed figure, small and tense,
Invisible beneath the night.
But from the depths, I heard a call—
A distant bell, a promise sung;
I lifted eyes, I braved the fall,
And found new strength in every rung.
Now, on the mountain’s golden crest,
I claim the life I once repressed.', 'probability': 1.0}
